import React, { useState } from "react";
import { Link } from "react-router-dom";

const Auth = () => {
    const [isLoggedIn, setIsLoggedIn] = useState(false);

    if (isLoggedIn) {
        return <button>Log Out</button>;
    } else {
        return (
            <div>
                <Link to="/login">Log In</Link>
                <Link to="/register">Register</Link>
            </div>
        );
    }
};

export default Auth;
